import React,{useState} from "react";


const Register = () =>{


const [name,setName] = useState('')
const [email,setEmail] = useState('')
const [dob,setDob] = useState('')
const [phone,setPhone] = useState('')
const [password,setPassword] = useState('')
const [confirmPassword,setConfirmPassword] =useState('')

// function handleSignUp(e){
//     setName(e.target.value);
//     setEmail(e.target.value);
//     setDob(e.target.value);
//     setPhone(e.target.value);
//     setPassword(e.target.value);
//     setConfirmPassword(e.target.value);
// }

function handleSubmit(e){
    e.preventDefault();

    const user = {name,email,dob,phone,password,confirmPassword};
    console.log(user);
}


    return(
        <div className="registerform card">
            <div className="card-body">
                <h2 className="card-title p-3">Create an Account</h2>
                <form action="#">
                    <div className="form-floating mb-3">
                        <input type="text"
                            id="floatingInput"
                            name="name"
                            value={name}
                            onChange={(e)=>setName(e.target.value)}
                            placeholder="Enter your Name"
                            required
                            autoComplete="off"
                            className="form-control"/>
                        <label for="floatingInput">Name</label>
                    </div>
                    <div className="form-floating mb-3">
                        <input type="email" 
                            id="floatingInput"
                            name="email"
                            value={email}
                            onChange={(e)=>setEmail(e.target.value)}
                            placeholder="Enter your Email"
                            required
                            autoComplete="off"
                            className="form-control"  />
                        <label for="floatingInput">Email</label>
                    </div>
                    <div className="form-floating mb-3">
                        <input type="date" 
                            id="floatingDate"
                            name="dob"
                            value={dob}
                            onChange={(e)=>setDob(e.target.value)}
                            placeholder="Enter your Date of Birth"
                            required
                            autoComplete="off"
                            className="form-control"  />
                        <label for="floatingDate">Date of Birth</label>
                    </div>
                    <div className="form-floating mb-3">
                        <input type="Phone" 
                            id="floatingInput"
                            name="phone"
                            value={phone}
                            onChange={(e)=>setPhone(e.target.value)}
                            placeholder="Enter your Phone"
                            required
                            autoComplete="off"
                            className="form-control"  />
                        <label for="floatingInput">Phone</label>
                    </div>
                    <div className="form-floating mb-3">
                        <input type="password" 
                            id="floatingPassword"
                            name="password"
                            value={password}
                            onChange={(e)=>setPassword(e.target.value)}
                            placeholder="Enter your Password"
                            required
                            autoComplete="off"
                            className="form-control"  />
                        <label for="floatingPassword">Password</label>
                    </div>
                    <div className="form-floating">
                        <input type="Password" 
                            id="floatingPassword"
                            name="confirmPassword"
                            value={confirmPassword}
                            onChange={(e)=>setConfirmPassword(e.target.value)}
                            placeholder="Enter your confirm Password"
                            required
                            autoComplete="off"
                            className="form-control"  />
                        <label for="floatingPassword">Confirm Password</label>
                    </div>
                    <div class="col-12 mt-4">
                        <button type="submit" className="btn btn-success w-100" onClick={handleSubmit}>Register</button>
                    </div>
                    <br />
                    <p className="form-text">
                        Already have an account? <a href="/login" className="form-link text-black">Login here</a>
                    </p>
                </form>
            </div>
        </div>
    )
}

export default Register;
